    body {
        margin: 0;
        width: 100%;
        height:100%
    }

        font-family:arial, sans-serif
    }

    input, textarea, select {
        font-size:100%
    }

    #loading {
        position: absolute;
        width: 100%;
        height: 100%;
        z-index: 1000;
        background-color:#fff
    }

        color: #757575;
        font-size: 20px;
        letter-spacing: .2px;
        line-height: 20px;
        text-align: center
    }

    #nlpt {
        animation: a-s .5s 2.5s 1 forwards;
        background-color: #f1f1f1;
        height: 4px;
        margin: 56px auto 20px;
        opacity: 0;
        overflow: hidden;
        position: relative;
        width: 300px
    }

    #nlpt::before {
        animation: a-lb 20s 3s linear forwards;
        background-color: #db4437;
        content: '';
        display: block;
        height: 100%;
        position: absolute;
        transform: translateX(-300px);
        width: 100%
    }

    @keyframes a-lb {
        0% {
            transform:translateX(-300px)
        }

        5% {
            transform:translateX(-240px)
        }

        15% {
            transform:translateX(-30px)
        }

        25% {
            transform:translateX(-30px)
        }

        30% {
            transform:translateX(-20px)
        }

        45% {
            transform:translateX(-20px)
        }

        50% {
            transform:translateX(-15px)
        }

        65% {
            transform:translateX(-15px)
        }

        70% {
            transform:translateX(-10px)
        }

        95% {
            transform:translateX(-10px)
        }

        100% {
            transform:translateX(-5px)
        }
    }

    @keyframes a-s {
        100% {
            opacity:1
        }
    }

    @keyframes a-h {
        100% {
            opacity:0
        }
    }

    @keyframes a-nt {
        100% {
            transform:none
        }
    }

    @keyframes a-e {
        43% {
            animation-timing-function: cubic-bezier(.8, 0, .2, 1);
            transform:scale(.75)
        }

        60% {
            animation-timing-function: cubic-bezier(.8, 0, 1, 1);
            transform:translateY(-16px)
        }

        77% {
            animation-timing-function: cubic-bezier(.16, 0, .2, 1);
            transform:none
        }

        89% {
            animation-timing-function: cubic-bezier(.8, 0, 1, 1);
            transform:translateY(-5px)
        }

        100% {
            transform:none
        }
    }

    @keyframes a-ef {
        24% {
            animation-timing-function: cubic-bezier(.8, 0, .6, 1);
            transform:scaleY(.42)
        }

        52% {
            animation-timing-function: cubic-bezier(.63, 0, .2, 1);
            transform:scaleY(.98)
        }

            animation-timing-function: cubic-bezier(.8, 0, .84, 1);

        }

        100% {

        }

            animation-timing-function: cubic-bezier(.63, 0, .2, 1);
            opacity:.03
        }

        83% {
            animation-timing-function: cubic-bezier(.8, 0, .84, 1);
            opacity:.05
        }

        100% {
            opacity:0
        }
    }

    @keyframes a-es {
        24% {
            animation-timing-function: cubic-bezier(.8, 0, .6, 1);
            transform:rotate(-25deg)
        }

        52% {
            animation-timing-function: cubic-bezier(.63, 0, .2, 1);
            transform:rotate(-42.5deg)
        }

        83% {
            animation-timing-function: cubic-bezier(.8, 0, .84, 1);
            transform:rotate(-42deg)
        }

        100% {
            transform:rotate(-43deg)
        }
    }

    .la-e {

    }

        border-radius: 0 25px 0 0;

        transform-origin:bottom left
    }

    .la-k .la-m {
        background: #fff;
        top:-166px
    }

    .la-i {
        animation: .9s linear 1.2s kf-v;

    }

    .la-i > .la-l, .la-i > .la-r {

    @keyframes kf-e {

            opacity: 0;

        }

        33% {
            animation-timing-function: cubic-bezier(.21, .02, .03, .92);
            opacity: 1;
            transform:scale(.8)
        }

        50% {
            animation-timing-function: linear;
            transform:scale(.96)
        }
    }

    @keyframes kf-c {
        25% {
            animation-timing-function: cubic-bezier(.17, .98, .38, 1);
            transform:scale(1.1)
        }

        to {
            transform:none
        }
    }

    @keyframes kf-s {
        35% {
            animation-timing-function: cubic-bezier(.17, .34, .69, .78);
            transform:scale(.88)
        }

        to {
            transform:none
        }
    }

        }
    }

    .invfr {

    }

        position: absolute;
        right: 0;
        font-size: 12px;
        font-weight: normal;
        color: #000;
        padding: 20px
    }
